import React from 'react';

const Cart=({img,title,price})=>{

    const imgStyle={
        width:'60px',
        height:'160px'
    }
    const wrapStyle={
        width:'350px',
        height:'100%',
        margin:'0 auto',
        display:'flex',
        flexWrap:'wrap',
        color:'white'

    }
    const titleStyle={
        width:'200px',
        height:'160px'
    }
    const priceStyle={
        width:'90px',
        height:'160px'
    }

    return <div style={wrapStyle}>

    {(img==null)?<div></div>:
       <img src={require('../static/'+img)} style={imgStyle}></img>
    }
      <div style={titleStyle}> 
          <h2>{title}</h2>{console.log('title',title)}{console.log('img',img)}
      </div>
       <div style={priceStyle}>
           {price}
       </div>
    </div>
}

export default Cart;
